import React from "react";

const Services = (props) => {
  return (
    <div className="services-section-item">
      <img src={props.image} className="services-section-item-image" alt="" />

      <div className="services-section-item-text">
        <h3 className="services-section-item-heading">{props.title}</h3>
        <div className="services-section-item-sub">
          <h5 className="services-section-item-sub-details">{props.details}</h5>
          <a href="#booking" className="services-section-item-sub-link">
            Book Now
          </a>
        </div>
      </div>
    </div>
  );
};

export default Services;
